WHEN 'report16' THEN SET @queryy="SELECT DISTINCT(c.nombre), (SELECT COUNT(cv.paredes) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.paredes='Ladrillo') Pared_Ladrillo, (SELECT COUNT(cv.paredes) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.paredes='Adobe') Pared_Adobe, (SELECT COUNT(cv.paredes) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.paredes='Piedra') Pared_Piedra,  (SELECT COUNT(cv.piso) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.piso='Tierra') Piso_Tierra, (SELECT COUNT(cv.piso) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.piso='Piedra') Piso_Piedra, (SELECT COUNT(cv.piso) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.piso='Cemento') Piso_Cemento, (SELECT COUNT(cv.piso) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.piso='Machimbre') Piso_Machimbre, (SELECT COUNT(cv.piso) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.piso='Parket') Piso_Parket from datosnino dn RIGHT JOIN cim c ON (c.id_cim=dn.id_cim)";

WHEN 'report17' THEN SET @queryy=" SELECT DISTINCT(c.nombre), (SELECT COUNT(cv.tipo_vivienda) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.tipo_vivienda='Departamento') Departamento, (SELECT COUNT(cv.tipo_vivienda) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.tipo_vivienda='Casa Independiente') Casa_Independiente, (SELECT COUNT(cv.tipo_vivienda) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.tipo_vivienda='Casa Compartida') Casa_Compartida, (SELECT COUNT(cv.tipo_vivienda) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.tipo_vivienda='Cuarto Multiple') Cuarto_Multiple, (SELECT Departamento)+(SELECT Casa_Independiente)+(SELECT Casa_Compartida)+(SELECT Cuarto_Multiple) Total  from datosnino dn RIGHT JOIN cim c ON (c.id_cim=dn.id_cim)";

WHEN 'report18' THEN SET @queryy=" SELECT DISTINCT(c.nombre), (SELECT COUNT(cv.vivienda_es) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.vivienda_es='Propia') Propia, (SELECT COUNT(cv.vivienda_es) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.vivienda_es='Anticretico') Anticretico, (SELECT COUNT(cv.vivienda_es) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.vivienda_es='Alquiler') Alquiler, (SELECT COUNT(cv.vivienda_es) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.vivienda_es='Cedida') Cedida, (SELECT COUNT(cv.vivienda_es) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.vivienda_es='Compartida') Compartida, (SELECT COUNT(cv.vivienda_es) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.vivienda_es='Cuidadora') Cuidadora, (SELECT Propia)+(SELECT Anticretico)+(SELECT Alquiler)+(SELECT Cedida)+(SELECT Compartida)+(SELECT Cuidadora) Total from datosnino dn RIGHT JOIN cim c ON (c.id_cim=dn.id_cim)";

WHEN 'report19' THEN SET @queryy="SELECT DISTINCT(c.nombre), (SELECT COUNT(*) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.energia_electrica='Si') Energia_Electrica, (SELECT COUNT(*) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.agua_potable='Si') Agua_Potable, (SELECT COUNT(*) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.vertiente='Si') Vertiente, (SELECT COUNT(*) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.gas_domiciliario='Si') Gas_Domiciliario, (SELECT COUNT(*) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.alcantarillado='Si') Alcantarillado, (SELECT COUNT(*) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.internet='Si') Internet, (SELECT COUNT(*) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.tv_cable='Si') Tv_Cable, (SELECT COUNT(*) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.telefono_fijo='Si') Telefono_Fijo, (SELECT COUNT(*) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.telefono_movil='Si') Telefono_Movil, (SELECT COUNT(*) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.vehiculo_propio='Si') Vehiculo_Propio, (SELECT COUNT(*) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.vehiculo_medio_trabajo='Si') Vehiculo_Medio_Trabajo from datosnino dn RIGHT JOIN cim c ON (c.id_cim=dn.id_cim)";

WHEN 'report20' THEN SET @queryy="SELECT DISTINCT(c.nombre),(SELECT COUNT(cv.transporte_trasladarse_cim) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.transporte_trasladarse_cim='A pie') A_pie,(SELECT COUNT(cv.transporte_trasladarse_cim) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.transporte_trasladarse_cim='Micro o bus') Micro_o_Bus,(SELECT COUNT(cv.transporte_trasladarse_cim) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.transporte_trasladarse_cim='Minibus') Minibus,(SELECT COUNT(cv.transporte_trasladarse_cim_otro) FROM caracteristicasvivienda cv INNER JOIN datosnino dn2 on(cv.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and cv.transporte_trasladarse_cim_otro is not null and cv.transporte_trasladarse_cim_otro!='') Otro,(SELECT A_pie)+(SELECT Micro_o_bus)+(SELECT Minibus)+(SELECT Otro) Total from datosnino dn RIGHT JOIN cim c ON (c.id_cim=dn.id_cim)";
WHEN 'report21' THEN SET @queryy="SELECT DISTINCT(c.nombre),(SELECT COUNT(f.trabajo) FROM familiares f INNER JOIN datosnino dn2 on(f.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and f.trabajo='Permanente') Permanente,(SELECT COUNT(f.trabajo) FROM familiares f INNER JOIN datosnino dn2 on(f.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and f.trabajo='Eventual') Eventual,(SELECT COUNT(f.trabajo) FROM familiares f INNER JOIN datosnino dn2 on(f.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and f.trabajo='Desempleado(a)') Desempleado,(SELECT COUNT(f.trabajo) FROM familiares f INNER JOIN datosnino dn2 on(f.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and f.trabajo='Independiente formal') Independiente_formal,(SELECT COUNT(f.trabajo) FROM familiares f INNER JOIN datosnino dn2 on(f.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and f.trabajo='Independiente informal') Independiente_informal,(SELECT COUNT(f.trabajo) FROM familiares f INNER JOIN datosnino dn2 on(f.id_nino=dn2.id_nino) WHERE dn2.id_cim=c.id_cim and f.trabajo!='Permanente' and f.trabajo!='Eventual' and f.trabajo!='Desempleado(a)' and f.trabajo!='Independiente formal' and f.trabajo!='Independiente informal') Otro,(SELECT Permanente)+(SELECT Eventual)+(SELECT Desempleado)+(SELECT Independiente_formal)+(SELECT Independiente_informal)+(SELECT Otro) Total from datosnino dn RIGHT JOIN cim c ON (c.id_cim=dn.id_cim)";

end CASE;
  
PREPARE stmt FROM @queryy;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `reports` (IN `input` VARCHAR(10))  BEGIN
set @input=input;
CASE @input 
WHEN 'report1' THEN SET @query="SELECT DISTINCT(c.nombre ), (SELECT COUNT(*) FROM personal p WHERE p.id_cim=c.id_cim and p.grupo_etareo = 'Lactantes')as lact,(SELECT COUNT(*) FROM personal p WHERE p.id_cim=c.id_cim and p.grupo_etareo = 'Infantes')as infa,(SELECT COUNT(*) FROM personal p WHERE p.id_cim=c.id_cim and p.grupo_etareo = 'Pre infantes')as prei,(SELECT COUNT(*) FROM personal p WHERE p.id_cim=c.id_cim and p.cargo = 'Responsable')as resp,(SELECT COUNT(*) FROM personal p WHERE p.id_cim=c.id_cim and p.cargo = 'Educadora')as educ, (SELECT COUNT(*) FROM personal p WHERE p.id_cim=c.id_cim and p.cargo = 'Manipuladora')as mani,(SELECT resp)+(SELECT educ)+(SELECT mani) as tCargo FROM personal pp RIGHT join cim as c on (pp.id_cim=c.id_cim)";
WHEN 'report2' THEN SET @query="SELECT DISTINCT (aa.fecha_ingreso), c.nombre, a.alimento from alimentos a , actaalimentos aa, cim c where aa.id_cim=c.id_cim AND aa.id=a.actaalimentos_id ORDER by c.nombre, aa.fecha_ingreso";
WHEN 'report3' THEN SET @query="SELECT c.nombre, cdc.reunion_eleccion_cdc as 'Comite de calidad' from cdc, cim c WHERE c.id_cim=cdc.id_cim";

WHEN 'report4' THEN SET @query="SELECT c.nombre,cdc.id as CDC, n.nombres, n.apellidos from nominacdc n, cdc, cim c WHEREn.cdc_id=cdc.id  and cdc.reunion_eleccion_cdc = 'Si'and c.id_cim=cdc.id_cim";

WHEN 'report5' THEN SET @query="SELECT c.nombre, p.tiene_pdm as 'tienePdm', p.pdm_aprobado as 'pdmAprob' FROM pdm p, cim c WHERE c.id_cim=p.id_cim";

WHEN 'report6' THEN SET @query="SELECT c.nombre, dn.nombres, dn.paterno, dn.materno, a.calendario, a.periodo from datosnino dn, asistencia a, cim c WHERE dn.id_nino = a.id_nino and dn.id_cim = c.id_cim order by c.nombre";

WHEN 'report7' THEN SET @query="SELECT nombre from cim";
WHEN 'report8' THEN SET @query="SELECT c.nombre, p.paterno, p.materno, p.nombres, p.cargo,a.calendario, a.periodo from personal p, asistencia_personal a, cim c WHERE p.id = a.personal_id and p.id_cim= c.id_cim order by c.nombre, p.paterno";

WHEN 'report9' THEN SET @query="SELECT c.nombre, Concat(dn.paterno,' ',dn.materno,' ', dn.nombres)as nombre , a.aporte FROM aportes a, datosnino dn, cim c WHERE c.id_cim = a.id_cim and a.id_nino = dn.id_nino ORDER by a.aporte, nombre,c.nombre ASC";

WHEN 'report10' THEN SET @query="SELECT c.nombre, sum(a.total_recaudado), a.total_cobrar FROM aportes a, cim c WHERE c.id_cim = a.id_cim GROUP by c.nombre ORDER by c.nombre ASC";

WHEN 'report11' THEN SET @query="SELECT nombre from cim";
WHEN 'report12' THEN SET @query="SELECT nombre from cim";
WHEN 'report13' THEN SET @query="SELECT nombre from cim";
WHEN 'report14' THEN SET @query="SELECT c.nombre, sp.apoyo_instancias,sp.nivel_aprobacion,sp.periodo_reunion_verificacion,sp.cantidad_miembros,sp.reporte_comite,sp.como_realiza_seguimiento, sp.dificultades,sp.dificultades, sp.solucion_dificultades FROM cim c, spdm sp\r\nWHERE c.id_cim = sp.id_cim";

WHEN 'report15' THEN SET @query="SELECT nombre from cim";
WHEN 'report16' THEN SET @query="SELECT nombre from cim";
WHEN 'report17' THEN SET @query="SELECT nombre from cim";
WHEN 'report18' THEN SET @query="SELECT nombre from cim";
end CASE;
    

PREPARE stmt FROM @query;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;
END$$

